import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Login = () => {
  const [formData, setFormData] = useState({
    email: 'test@example.com',
    password: 'test123'
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState('');
  
  const { login, user } = useAuth(); // Add user to see current state
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setMessage('üîÑ Attempting login...');

    console.log('üìß Login attempt with:', formData.email);
    console.log('üë§ Current user before login:', user);

    try {
      const result = await login(formData.email, formData.password);
      
      console.log('üìù Login result:', result);
      console.log('üë§ User after login call:', user); // This might not be updated yet
      
      if (result.success) {
        setMessage('‚úÖ Login successful! Redirecting...');
        
        // Wait a bit for state to update, then redirect
        setTimeout(() => {
          console.log('üîÑ Redirecting to home page...');
          navigate('/', { replace: true });
        }, 1000);
      } else {
        setMessage('‚ùå ' + result.message);
      }
    } catch (error) {
      setMessage('üí• Login error: ' + error.message);
      console.error('Login error:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-container">
      <div className="auth-card">
        <div className="auth-header">
          <div className="auth-logo">üé™ EventHub</div>
          <h2 className="auth-title">Welcome Back</h2>
          <p className="auth-subtitle">Sign in to your account</p>
        </div>

        {message && (
          <div className={`auth-message ${message.includes('‚úÖ') ? 'success' : 'error'}`}>
            {message}
          </div>
        )}

        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-group">
            <div className="input-container">
              <span className="input-icon">üìß</span>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                className="form-input"
                placeholder="Enter your email"
                required
              />
            </div>
          </div>

          <div className="form-group">
            <div className="input-container">
              <span className="input-icon">üîí</span>
              <input
                type="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                className="form-input"
                placeholder="Enter your password"
                required
              />
            </div>
          </div>

          <button 
            type="submit" 
            className={`auth-btn ${loading ? 'loading' : ''}`}
            disabled={loading}
          >
            {loading ? (
              <>
                <span className="spinner"></span>
                Signing In...
              </>
            ) : (
              'üöÄ Sign In'
            )}
          </button>
        </form>

        <div className="auth-footer">
          <p>
            Don't have an account?{' '}
            <Link to="/register" className="auth-link">
              Create an account here
            </Link>
          </p>
        </div>

        <div className="demo-info">
          <div className="demo-header">
            <span className="demo-icon">üêõ</span>
            <strong>Debug Info</strong>
          </div>
          <p>Check browser console for detailed logs</p>
          <p>Current user: {user ? user.name : 'Not logged in'}</p>
        </div>
      </div>
    </div>
  );
};

export default Login;
